window.bookSummaryJSON = "<p><b>This is the complete series of Minotaur's Maze of Monster Girls.</b></p> <p>After slaying a leviathan of the deep, and gaining a magic he barely understands, an ordinary fisherman finds himself entangled in a magical game of the gods with the fate of his planet as the prize.</p> <p>Dean becomes Oakley's champion, competing in the Minotaur's Maze. He travels through a portal to Mixonia, a city of wonders, filled with magic and monster girls of all sorts. As he levels up in his noble quest to save his home world, he will earn and lose fortunes, rescue a bevy of beautiful babes, and protect the innocents of planet Oakley.</p>"; 
